import React, { useState } from "react";
import Button from '@mui/material/Button';

export const Signin = (props) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
    }
    return (
        <div className="auth-form">
            <form className = "signin-form" onSubmit={handleSubmit}>
                <label htmlFor="email">Email: </label>
                <input value={email} type="email" placeholder="example@gmail.com" />
                <label htmlFor="password">Password: </label>
                <input value={password} type="password" placeholder="**********" />
                <Button variant = "contained" type = "submit">Log In!</Button>
            </form>
            <Button variant = "contained" onClick={() => props.onFormSwitch('Signup')}>If you don't already have an account, register here!</Button>
        </div>
    )
}
